import React from "react";
import MainHOC from "../component/main.hoc";

const Search = () => {
  return (
    <MainHOC>
      <div className="card">
        <div className="field-label is-normal">
          <label className="label">ค้นหาข้อมูลเงินเดือน ตั้งแต่มกราคม 2563</label>
        </div>
      </div>
    </MainHOC>
  );
};
export default Search;
